function App() {

  const [products, setProducts] = useState([]);

  useEffect(() => {
    fetch('/api/products')
     .then(res => res.json())
     .then(data => setProducts(data))
     .catch(err => console.error(err));
  }, []);
  return (
    <main>
      <h1>Example</h1>
    </main>
  );
}

export default App;
